Fit like a charm..<br />
This &quot;filament feed&quot; sits on top of the dual extruder of my CTC machine.  I was having terrible issues with &quot;bind&quot; as the original tubes simply sit on the top of the extruder and I could hear it &quot;popping&quot;  
This took some cleaning work so the threads would work but combined with the &quot;rear filament&quot; piece, has resolved all my issues with filament binding
